import React from 'react';


const List = ({item}) => {
  return (
    <>
    <div className='text-ex'>
      <div className='num-display'>{item.rating}</div>
      <div>{item.text}</div>
    </div>
     {/* <h1>Name Lists...</h1>
     <ul>
        {item.names.map((i)=>(
            <li>{i}</li>
        ))} 
    </ul> */}
    </>
  )
}

export default List;
